import { Button,Text ,View } from 'react-native';
import React from 'react';
import StyleHeader from './StyleSettings';

const Header = ()=>{
    return <View style = {StyleHeader}>
            <View><Button title='But'></Button></View>
            <Text>tag</Text>
            <Text>Name</Text>
            <Text>Phonenumber</Text>
    </View>

}

export default Header;
